import React from "react";
import CustomerTable1 from "../components/UI/table/table";

const Stock = () => {
    const httpUrl = 'http://localhost:8000/customers'; // Endpoint for customers

    return (
        <div>
            <h1>Welcome To Stock Page</h1>
            <CustomerTable1 FetchUrl={httpUrl} />
        </div>
    );
};

export default Stock;
